script: |
  super -f text -I q4114.spq | sort > q4114.out

inputs:
  - name: q4114.spq
    data: |
      SELECT DISTINCT 39 + ( - 6 + ( + col2 + col0 * col2 ) ) AS col1 FROM tab2 (FORMAT parquet) WHERE NOT - ( ( CAST ( - col1 AS INTEGER ) ) ) / 27 NOT IN ( col2 );
  - name: tab2

outputs:
  - name: q4114.out
    data: |
